import './HeaderPreview.scss';
import { useTypewriter } from 'react-simple-typewriter'

const HeaderPreview = () => {
    return (
        <section className='main-page__head'>
            <div className='main-page__head__title'>
                <h1 className='main-page__head__title__value'>
                    Hi, I'm <br></br>
                    <em className="main-page__head__title__value__pink-text">
                        Toshal Lubana
                    </em>
                    <br></br>
                    <useTypewriter 
                        loop
                        words={['FrontEnd Engineer','React.js Deeloper','Javascript Developer']}
                        cursor
                        typeSpeed={70}
                        delaySpeed={1000} 
                    />
                </h1>
            </div>
        </section>
    )
}
export default HeaderPreview;
